import ReactDOM from "react-dom";
var fname,lname;
fname="mujjkir";
lname="ansari";
var i=2;
var j="i have ";
function funny(m=10,n=9){
   var m,n,c;
   c=m+n;
   return c
   

}



ReactDOM.render(
   <>
    <h1>my name is  {`${fname} ${lname} ${i} ${j} legs`}</h1>
    
    </>
 ,document.getElementById("root"));
